import React from "react";

export default function Card1(props){
    function click(){
        return(
            <h2>Hi</h2>
        )
    }
    return(
        <div className="card" onClick={click}>
            <img src={props.image} alt={props.alt} />
            <h4>{props.title}</h4>
            <p>{props.body}</p>
        </div>
    )
}
